import mc from "./app.module.scss";
import { useEffect } from "react";

const App = () => {
  const test = false;
  useEffect(() => {
    if (test) {
      console.log("true");
    } else {
      console.log("false");
    }
  }, []);

  return (
    <div className={mc.container}>
      <span>test</span>
      <canvas></canvas>
    </div>
  );
};

export default App;
